import React from 'react';
import Search from './Search';

const Countries = () => {
  const onSearchSubmit = (input: string) => {
    dispatch({ type: 'submit_search', payload: input });
  };

  return (
    <div>
      <Search onSearchSubmit={onSearchSubmit} />
    </div>
  );
};

export default Countries;
